import math

def is_prime(n):
    if n <= 1:
        return False
    if n <= 3:
        return True
    if n % 2 == 0 or n % 3 == 0:
        return False
    i = 5
    while i * i <= n:
        if n % i == 0 or n % (i + 2) == 0:
            return False
        i += 6
    return True

def prime_factors(n):
    factors = set()
    for i in range(2, int(math.sqrt(n)) + 1):
        while n % i == 0:
            factors.add(i)
            n //= i
    if n > 1:
        factors.add(n)
    return factors

def count_prime_factor_primes(l, r):
    count = 0
    for i in range(l, r + 1):
        factors = prime_factors(i)
        if is_prime(len(factors)):
            count += 1
    return count

l, r = map(int, input().split())
print(count_prime_factor_primes(l, r))
